  playlist_id = rng.rand(28) + 1
  user_id = rng.rand(6) + 2
  next if pf.include?([user_id, playlist_id])
  PlaylistFollow.create(user_id: user_id, playlist_id: playlist_id)
  pf << [user_id, playlist_id]
