uf = []
20.times do
  follow_id = rng.rand(7) + 1
  user_id = rng.rand(6) + 2
  next if uf.include?([user_id, follow_id])
  next if user_id == follow_id
  UserFollow.create(user_id: user_id, followed_user_id: follow_id)
  uf << [user_id, follow_id]
end
